public static List<BigDecimal> buildFlow(BigDecimal creditSum, BigDecimal totalAmount, BigDecimal payment, boolean first, BigDecimal onceCommission, BigDecimal monthlyFee, BigDecimal graceTerm) {
    def payments = new ArrayList<BigDecimal>()
    if (first) {
        payments.add(-creditSum)
    }
    if (graceTerm > 0) {
        payments.add(monthlyFee)
    }
    while (graceTerm-1 > 0) {
        payments.add(monthlyFee)
        graceTerm--
    }
    while (totalAmount >= payment) {
        totalAmount -= payment
        if (totalAmount < 10) {
            payment += totalAmount
            totalAmount = 0
        }
        payments.add(payment)
    }
    if (totalAmount > 0 && !first) {
        payments.add(totalAmount.setScale(2,0))
    }
    return payments
}
public static BigDecimal IRR(List<BigDecimal> values) {
    def maxIterationCount = 20;
    def absoluteAccuracy = 1E-7;
    def x0 = 0.01;
    def x1;
    def i = 0;
    while (i < maxIterationCount) {
        def fValue = 0g;
        def fDerivative = 0g;
        for (int k = 0; k < values.size(); k++) {
            fValue += values[k] / Math.pow(1.0 + x0, k);
            fDerivative += -k * values[k] / Math.pow(1.0 + x0, k + 1);
        }
        x1 = x0 - fValue/fDerivative;
        if (Math.abs(x1 - x0) <= absoluteAccuracy) {
            return x1;
        }
        x0 = x1;
        ++i;
    }
    return BigDecimal.ZERO;
}
public static BigDecimal calcAnnuity(BigDecimal creditSum, BigDecimal rate, BigDecimal term) {
    def mc = new MathContext(10)
    def monthlyRate = (rate.divide(100 as BigDecimal, mc)).divide(12 as BigDecimal, mc)
    def monthlyRatePlusOne = monthlyRate.add(BigDecimal.ONE, mc)
    def top = monthlyRate.multiply(creditSum, mc)
    def bottom = BigDecimal.ONE.subtract(monthlyRatePlusOne.pow(-term.intValue(), mc), mc)
    return top.divide(bottom, mc)
}
public static BigDecimal CALCPSK(BigDecimal creditSum, BigDecimal rate, BigDecimal term, BigDecimal down) {
    if (creditSum <= down) {
      return 0
    }
    def annuity = calcAnnuity(creditSum, rate, term).setScale(2, 0)
    def total = (annuity * term).setScale(0, 0)
    def flow = buildFlow(creditSum - down, total, annuity, true)
    def irr = IRR(flow).setScale(7, 1)
    return irr * 12 * 100
}
public static BigDecimal calcAnnuityFactor(BigDecimal monthlyRate, BigDecimal term) {
    def mc = new MathContext(10)
    def monthlyRatePlusOne = monthlyRate.add(BigDecimal.ONE, mc)
    def monthlyRatePlusOnePow = monthlyRatePlusOne.pow(term.intValue(), mc)
    def top = monthlyRate.multiply(monthlyRatePlusOnePow, mc)
    def bottom = monthlyRatePlusOnePow.subtract(BigDecimal.ONE, mc)
    return top.divide(bottom, mc)
}
public static BigDecimal CALCPSK2(BigDecimal creditSum, BigDecimal rate, BigDecimal term, BigDecimal down, BigDecimal graceTerm, BigDecimal graceRate) {
    def mc = new MathContext(10)
    def monthlyRate = (rate.divide(100 as BigDecimal, mc)).divide(12 as BigDecimal, mc)
    def graceMonthlyRate = (graceRate.divide(100 as BigDecimal, mc)).divide(12 as BigDecimal, mc)
    def annuityFactor = calcAnnuityFactor(monthlyRate, term - graceTerm).setScale(7, 0)
    def graceAnnuityFactor = calcAnnuityFactor(graceMonthlyRate, term).setScale(7, 0)
    def graceAnnuity = creditSum.multiply(graceAnnuityFactor).setScale(2, 0)
    def rest = creditSum
    def cnt = 0
    while (graceTerm > cnt++) {
        rest -= (graceAnnuity - rest * graceMonthlyRate).setScale(2, 0)
    }
    def annuity = rest.multiply(annuityFactor).setScale(2, 0)
    def total = (annuity * (term - graceTerm)).setScale(0, 0)
    def flow = buildFlow(creditSum - down,  (graceAnnuity * graceTerm), graceAnnuity, true)
    flow.addAll(buildFlow(0 as BigDecimal, total, annuity, false))
    def irr = IRR(flow).setScale(7, 1)
    return irr * 12 * 100
}
